// Component imports
import React, {useContext} from 'react';
import { useNavigate } from 'react-router-dom'; 
import {Button} from 'react-bootstrap';
import { TestContext } from '../TestContext';

import TestUser from './TestUser';

export default function HomePage(){
    const {testContext, setTestContext} = useContext(TestContext);
    const navigate = useNavigate();

    const onButton = () => {
        setTestContext({...testContext, number: testContext.number + 1});
    };

    const onUser = () => {
        navigate("/user");
    }

    return(
        <>
        <h1>{testContext.number}</h1>
        <Button onClick={onButton}>Add 1</Button>
        </>
    );
}
